import React from 'react';

const FileUploader = ({ onChange }) => {
    const handleFileChange = (e) => {
        onChange(e.target.files[0]);
    };

    return (
        <div>
            <label>Upload File:</label>
            <input type="file" onChange={handleFileChange} />
        </div>
    );
};

export default FileUploader;
